import mantenimiento from '../utils/mantenimiento.png'


export default function Lugares() {
    return (
        <div className="contenedor-titulo">
            <h1 id="titulo">En Mantenimiento!</h1>
            <img id="img-mantenimiento" src={mantenimiento}></img>
        </div>
    )
}
